    false,nt"url": null,nt"notes": "The dredging of the lower Columbia River
    for shipping has created flat sand islands that attract nesting seabirds.  These
    seabird colonies are situated in prime salmon rearing areas and the birds from these
    colonies feed heavily on salmon smolt.  There has been a concerted effort from the
    Corps of Engineers and OSU to haze terns and cormorants on many of these islands,
    however, a large gull colony, mostly glaucous-winged and western gulls, still persists
    on Rice Island.  In addition, some terns continue to nest there despite intense
    hazing.  This colony is probably the largest gull colony in WA and OR and represents
    a significant wildlife resource.  Because it occurs within the boundaries of the
    L&C, the Refuge has an interest in tracking its size and long-term stability.  Contention
    over salmon predation and its effects on commercial and recreational fishing is
    only expected to increase, and knowledge of the size and trends of this colony will
    help with management and public information.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
